import React from "react";
export default function PokemonCard({ p }) {
  return (
    <div style={{ border: "1px solid #ddd", padding: 12, borderRadius: 8 }}>
      <h3>{p.name}</h3>
      <p>{p.description}</p>
      <div>Type: {p.type}</div>
      <div>HP: {p.hp}</div>
    </div>
  );
}
